import React from 'react';
import Admin from './Admin';
import video from '../video1.mp4';
import './adminplayer.css';


class Adminplayer extends React.Component{
    constructor(props){
        super(props)
        {console.log(this.props.Login)}
    }



    render(){
        return(
            <>
               <div id="main">
                  <div id='sidebar'>
                   <ol>
                    <li>upload video</li>
                    <li>playlist</li>
                    </ol>
                  </div>
                  <div id='maincontent'>
                    <table>
                        <thead>
                            <tr>
                                <th>videos</th>
                                <tr><video><source src={video} /></video></tr>
                            </tr>
                        </thead>
                    </table>
                  </div>
               </div>
            </>
        )
    }
}

export default Adminplayer;
